  ratingHeading: {
    fontSize: "14px",
    marginBottom: theme.spacing(1),
    fontWeight: "bold",
    color: theme.palette.dark.main,
  },
  ratingStars: {
    transform: "scale(1.5)",
  },
  feedbackHeading: {
    color: theme.palette.dark.main,
    fontSize: "14px",
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    fontWeight: "bold",
  },
  submitBtn: {
    marginTop: theme.spacing(2),
    color: theme.palette.light.main,
    paddingRight: theme.spacing(2),
    paddingLeft: theme.spacing(2),
  },
  ratingsFeedbacksHeading: {
    marginTop: theme.spacing(4),
    padding: theme.spacing(1),
    color: theme.palette.primary.main,
  },
  ratingsFeedbacksContainer: {
    maxWidth: "100%",
    display: "flex",
    flexWrap: "wrap",
  },
  feedbackCard: {
    flexGrow: 1,
    width: "300px",
    minHeight: "200px",
    boxShadow: "none",
    margin: theme.spacing(1),
    padding: theme.spacing(4),
    border: `1px solid ${theme.palette.primary.light}`,
  },
  cardName: {
    fontSize: "16px",
    fontWeight: "bold",
    color: theme.palette.primary.main,
  },
  cardRating: {
    marginTop: theme.spacing(1),
  },
  cardFeedback: {
    marginTop: theme.spacing(1),
  },
  cardTag: {
    display: "inline-block",
    fontWeight: "bold",
    fontFamily: "Cookie, cursive",
    fontSize: "20px",
    marginTop: theme.spacing(2),
    backgroundImage: `linear-gradient(45deg, ${theme.palette.primary.main}, ${theme.palette.secondary.main})`,
    backgroundSize: "100%",
    WebkitBackgroundClip: "text",
    MozBackgroundClip: "text",
    WebkitTextFillColor: "transparent",
    MozTextFillColor: "transparent",
  },
  dFlexBetween: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "start",
  },
  ml3: {
    marginLeft: theme.spacing(3),
  },
}));

function RatingFeedback() {
  const classes = useStyles();
  const [rating, setRating] = useState(0);
  const [feedback, setFeedback] = useState("");
  const [disable, setDisable] = useState(false);

  function postFeedback() {
    setDisable(true);
  }

  return (
    <div className={classes.content}>
      <Typography variant="h6" component={"h1"} className={classes.heading}>
        RATINGS AND FEEDBACKS
      </Typography>
      <Typography
        variant="h6"
        component={"h2"}
        className={classes.ratingFeedbackHead}
      >
        Your Feedback
      </Typography>
      <Card className={classes.ratingFeedbackCard}>
        <Typography
          variant="h6"
          component={"h6"}
          className={classes.ratingHeading}
        >
          Please Rate Us
        </Typography>
        <Rating
          name="simple-controlled"
          size="large"
          value={rating}
          onChange={(_, val) => setRating(val)}
        />
        <Typography
          variant="h6"
          component={"h6"}
          className={classes.feedbackHeading}
        >
          Please Provide Feedback
        </Typography>
        <TextField
          variant={"outlined"}
          multiline
          fullWidth
          rows={8}
          InputLabelProps={{ shrink: true }}
          value={feedback}
          onChange={(_, val) => setFeedback(val)}
        />
        <Button
          className={classes.submitBtn}
          variant={"contained"}
          onClick={postFeedback}
          disabled={disable}
          color={"primary"}
        >
          Submit Feedback
          {disable ? <Progress color="primary" size={20} /> : ""}
        </Button>
      </Card>
      <Typography
        variant="h6"
        component={"h2"}
        className={classes.ratingsFeedbacksHeading}
      >
        Your Feedbacks
      </Typography>
      <div className={classes.ratingsFeedbacksContainer}>
        <Card className={classes.feedbackCard}>
          <div className={classes.dFlexBetween}>
            <div>
              <Typography
                variant="h6"
                component={"h3"}
                className={classes.cardName}
              >
                Muhammad Yousaf
              </Typography>
              <Rating
                name="simple-controlled"
                size="small"
                value={5}
                disabled
                className={classes.cardRating}
              />
            </div>
            <div>
              <IconButton aria-label="delete">
                <MdEdit />
              </IconButton>
              <IconButton aria-label="delete">
                <MdDelete />
              </IconButton>
            </div>
          </div>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
      </div>
      <Typography
        variant="h6"
        component={"h2"}
        className={classes.ratingsFeedbacksHeading}
      >
        Other People Feedbacks
      </Typography>
      <div className={classes.ratingsFeedbacksContainer}>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Muhammad Yousaf
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Junaid Akram
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Muhammad Asif
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            John William
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
        <Card className={classes.feedbackCard}>
          <Typography
            variant="h6"
            component={"h3"}
            className={classes.cardName}
          >
            Imran Ali
          </Typography>
          <Rating
            name="simple-controlled"
            size="small"
            value={5}
            disabled
            className={classes.cardRating}
          />
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardFeedback}
          >
            Adrien Brody and Milla Jovovich, "Dummy" is that special kind of
            indie comedy that knows how to perfectly balance its offbeat humor
            with just the right amount of dramatic intrigue.
          </Typography>
          <Typography
            variant="body1"
            component={"p"}
            className={classes.cardTag}
          >
            Powered By IntelliGenie
          </Typography>
        </Card>
      </div>
      <Modal
        aria-labelledby="Add Sub User"
        aria-describedby="Add Account of a sub user"
        className={classes.modal}
        open={addUser}
        onClose={addClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 300,
        }}
        style={{
          overflowY: "auto",
        }}
      >
        <Fade in={addUser}>
          <div className={classes.paper}>
            <Typography
              variant={"h5"}
              color={"primary"}
              id="transition-modal-title"
            >
              Add Sub User
            </Typography>
            <div className={classes.modalForm}>
              <div className={classes.modalForm}>
                <form
                  noValidate
                  onSubmit={handleSubmit((data) => {
                    AddSubUser(data);
                  })}
                >
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"First Name"}
                    name="firstName"
                    className={classes.formItem}
                    {...register("firstName", {
                      required: "First name required",
                      pattern: {
                        value: /^[a-zA-Z ]*$/,
                        message: "Invalid first name",
                      },
                    })}
                    error={Boolean(errors.firstName)}
                    helperText={errors.firstName?.message}
                    fullWidth
                  ></TextField>
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"Last Name"}
                    className={classes.formItem}
                    name="lastName"
                    {...register("lastName", {
                      required: "Last name required",
                      pattern: {
                        value: /^[a-zA-Z ]*$/,
                        message: "Invalid last name",
                      },
                    })}
                    error={Boolean(errors.lastName)}
                    helperText={errors.lastName?.message}
                    fullWidth
                  ></TextField>
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"Email"}
                    name="userEmail"
                    className={classes.formItem}
                    {...register("userEmail", {
                      required: "Email required",
                      pattern: {
                        value:
                          /^[a-zA-Z]+[a-zA-Z0-9_.-]{1,}\@([A-Za-z0-9_\-\.]){1,}\.([A-Za-z]){2,4}$/,
                        message: "Invalid email",
                      },
                    })}
                    error={Boolean(errors.userEmail)}
                    helperText={errors.userEmail?.message}
                    fullWidth
                  ></TextField>
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"Username"}
                    name="username"
                    className={classes.formItem}
                    {...register("username", {
                      required: "Username Required",
                      pattern: {
                        value: /^[a-zA-Z]+[a-zA-Z0-9_.-]{2,}$/,
                        minLength: {
                          value: 6,
                          message: "Username can not be less than 3 characters",
                        },
                        message: "Invalid Username",
                      },
                    })}
                    error={Boolean(errors.username)}
                    helperText={errors.username?.message}
                    fullWidth
                  ></TextField>
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"Password"}
                    className={classes.formItem}
                    name="password"
                    {...register("password", {
                      required: "Password Required",
                      minLength: { value: 6, message: "Invalid Password" },
                    })}
                    type={"password"}
                    fullWidth
                    error={Boolean(errors.password)}
                    helperText={errors.password?.message}
                  ></TextField>
                  <TextField
                    variant={"outlined"}
                    InputLabelProps={{ shrink: true }}
                    size={"medium"}
                    color={"primary"}
                    label={"Confirm Password"}
                    className={classes.formItem}
                    name="confirmPassword"
                    {...register("confirmPassword", {
                      required: "Confirm Password Required",
                      validate: (value) =>
                        value === password.current || "Passwords do not match",
                    })}
                    type={"password"}
                    error={Boolean(errors.confirmPassword)}
                    helperText={errors.confirmPassword?.message}
                    fullWidth
                  ></TextField>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      alignContent: "flex-end",
                      marginTop: "20px",
                    }}
                  >
                    <Button
                      variant={"contained"}
                      color="primary"
                      size="large"
                      type="submit"
                      disabled={disable}
                    >
                      Add Subuser
                      {disable ? <Progress color="primary" size={20} /> : ""}
                    </Button>
                    <Button
                      variant="contained"
                      disableElevation
                      onClick={addClose}
                    >
                      Close
                    </Button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </Fade>
      </Modal>
    </div>
  );
}

export default RatingFeedback;
